INSERT INTO `tbl_geng` VALUES ('72', '', '20,', '2023-01-28 170001.jpg', 'AUTO_ADD', '如果在高铁上，一个站票的人\n想和你换坐票，他的态度非常\n恶劣，甩了一万块给你，那你换\n不换？\n搞笑小妹1\n关注\n1天前·71.2万次观看\n评论\n1.5万表态\n305人播眼\n不下雪的广东·23小时前\n4.4万\n13\n我不允许你说他态度恶劣\n264条回复\n神评热榜TOP8\n2.5w条评论\n他只是说话大声了点，怎么就态度恶劣了？\n2天前·福建\n回复\n6.5w\n电\n作者赞过\n展开5579条回复\n什么态度恶劣明明是我没素质买了人家的票\n', '0', '0', '0', '1');
