INSERT INTO `tbl_geng` VALUES ('74', '', '20,', '2023-01-28 171024.jpg', 'AUTO_ADD', '昨天我偷偷带女友回家\n本以为家里没人\n结果我爸没出门\n他看了我一眼之后一直姨母笑\n然后他跟我说\n我不会跟你妈说的\n这是我们的小秘密\n刚刚吃早餐的时候\n我妈问我脖子上怎么有草莓印\n我想都没想就直接说\n这是我跟我爸之间的小秘密\n那一瞬间我觉得全世界都安静了\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('75', '', '20,', '2023-01-29 121352.jpg', 'AUTO_ADD', '“儿啊，你老实告诉我，我还有几日可活”\n“爸，想啥呢，院长都说你身体无碍，马上就可以出\n院。”\n“别骗我了，好多人来看我，连你也回来了。”\n儿子俯身在他耳边说道：\n“爸，我调回本市当书记了。”\n一一全国微型小说一等奖《病》\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('76', '', '20,', '2023-01-29 134047.jpg', 'AUTO_ADD', '几年前家里有亲戚做个大手术很\n成功，家里人为了感谢主刀医\n生，想着送面锦旗，开始写着“\n华佗在世，扁鹊重生”，堂弟瞟\n了一眼，随口说了一句：“人家\n是西医啊！”亲戚想了一下把锦\n旗拿去改成了“阿斯克勒庇俄斯\n在世，希波克拉底重生”，我永\n远忘了不医生收到锦旗时惊叹而\n复杂的表情\n', '0', '0', '0', '1');
