INSERT INTO `tbl_geng` VALUES ('123', '', '20,', '2022-12-07 165145.jpg', 'AUTO_ADD', '知乎\n15:21\n只邀请\n写回答\n知·1,370回合·5090天注\n匿名用户\n5人赞同了该回答\n体制内上班，一般体制内的车比较干净，毕竟\n年年都强制保养。\n有一次工作机缘，开了一次民政部门的车，怎\n么说呢，车是二手车，原先车主考上编制，变\n心嫌弃这辆车了。此车随后主动流动到其他地\n市民政部门。现在开了差不多一年了，也不嫌\n弃，车灯不大、小巧玲珑，手自一体，坐垫舒\n适，双缸均已开发，可缸内直喷。算是符合出\n厂地黄梅戏之乡的特征吧，胎噪可大可小，令\n人着迷。因工作原因调到隔壁地市，基本一个\n月还能开一次这辆车。有一次去方特玩，落地\n窗前暴力驾驶，真是令人回味。也不知道最后\n哪个老实人会拿到行驶证，随他吧，反正有钥\n匙，想开就开。\n发布于2022-12-0614：40·IP属地安徽·著作权归作者所有\n微信\n朋友圈\nQQ\n图片分享\n别再遗憾没人帮自己搬家了，来试试用货拉拉\n赞同5\n喜欢\n', '0', '0', '0', '1');
