INSERT INTO `tbl_geng` VALUES ('128', '', '20,', '2022-08-26 140240.jpg', 'AUTO_ADD', '第3章黄皮子讨封\n￥\n90金币\n≡菜单\n因为我想起了师父曾跟我讲过的一个\n诡异传说。\n传说，山精鬼怪类的东西，要修成正\n果的时候必须拦路求人，问你它像人还是\n像神，这叫讨封。\n你要说它像人，它这身道行就废了。\n你要说它像神，它能得正果，但以后\n还会缠着你，借你的命。⑨\n一念至此，我忍不住咽了口吐沫，定\n睛再看，就发现那哪里是一个老太太，分\n明是一只披着老太太衣服，站立行走的黄\n皮子！\n我被惊出了一声冷汗，而那沙哑的声\n音却再次响起，不停的催促：“快说，快\n说…”③\n正当我不知如何回答之际，喝的满脸\n通红的虎子却突然开口了。\n“我看你像傻逼。\"\n18:07\n多写评论会有更多人关注你哦\n0.32%\n请画线拯救所有人！\n查看详情\n小米应用商店\n穿山甲广告\n', '0', '0', '0', '1');
