INSERT INTO `tbl_geng` VALUES ('134', '', '20,', '2022-08-29 122040.png', 'AUTO_ADD', '12:20\n聊\n颜值\n真香\n汽车\n图片\n文字\n游戏\nseasee\n皮爹们，小弟和女朋友研究生都上岸了，但是学校离\n得稍微有点远，我俩商量了一下想买个二手车，预算\n三四万左右，不超过五万拿下，手动自动挡无所谓，\n因为主要是我开，空间没啥要求，一般只有我们两个\n人出门，希望外形稍微好看一点，动力无所谓，很少\n跑高速什么的，只用三年，毕业就卖掉，有没有懂得\n老哥指导一下小弟应该买什么，推荐推荐，谢谢皮爹\n们！\n向公公学习一辈子都学不完\n#汽车痴迷者·34万皮友正在看\n淡酒浓愁。\n神评\n3.6万\n推荐你买18年奇瑞瑞虎7手动版本，至于为什么推荐这款\n车，因为我有一辆想卖掉\n1万\n踩\n3505\n16\n取了好几个名字都被占用了\n皮友们，没想到轮到我了\n老婆查出肺结节增大，可能是肺癌\n7\n刷新\n发现\n消息\n我的\n', '0', '0', '0', '1');
