INSERT INTO `tbl_geng` VALUES ('141', '', '20,', '2022-09-04 202609.png', 'AUTO_ADD', '20:26\n沙井吧\n哈哈哈笑死了\n今天接了房产中介的电话，\n房产中介问我：买不买房子？再不买，\n2020年底放开调控，房价又要涨。\n我说：已经有几套了，没有钱也没有购房资\n格，不想买了！\n房产中介停顿了一下：那你的房子卖吗？房\n产税今年可能要出台了，现在房价这么高，\n恐怕到时候会跌很多。\n我感觉不说实话就不行了，就对他说：我其\n实没有房，也没钱买房，现在待业。\n房产中介沉默片刻：明天有个楼开盘，白天\n排队100，晚上自带凳子排队150，包盒饭\n矿泉水，另外拉一个朋友来看盘，单独奖\n励20，来吗？\n我说：天太热，排队时间又长，不想来。\n房产中介：周末还有一个楼盘开发商找群\n演，抗议开发商降价，闹\"退房\"，年龄要求\n30-50岁，男女皆可，需要推搡保安，砸售\n发贴千百度，文明第一步\n', '0', '0', '0', '1');
