INSERT INTO `tbl_geng` VALUES ('143', '', '20,', '2022-09-05 182736.jpg', 'AUTO_ADD', '在医院里就医遇到过最尴尬的事情是什\n么？\n查看全部1,886个回答\n邀请回答\n写回答\n紫金眼镜\n十关注\n一事无成两鬓斑\n太空精酿、印第安留学生赞同了该回答\n让医生觉得尴尬的事情能回答么…\n曾经有一次，患者要出院了，手术很顺利，恢复的\n也很好，但是出院之前患者来找我，拿着收费单，\n一项一项问我收费条目，我挨个给解释，直到这一\n条：\n患者：这个收的什么钱？\n我：手术一次性耗材。\n患者：比如呢？\n我：比如手套。\n患者：手套这么贵？\n我：这是无菌的，而且材质比较特殊，跟一般的手\n套不一样。\n患者：哦，这手套做手术时戴着的？\n我：是的。\n患者：你戴我戴？\n我：当然是我戴。\n患者：你戴手套找我收钱？\n别说，当时我真的，一瞬间，觉得他说的有那么一\n点道理\n', '0', '0', '0', '1');
