INSERT INTO `tbl_geng` VALUES ('145', '', '20,', '2022-09-06 110427.png', 'AUTO_ADD', '11:041\n11\n<\n156~\n关注\n最热评论\n●●\n3小时前浙江\n回复\n317\n黑管黑炮：一辈子也玩不了几次天胡金鳞龙\n啊！\n没得好名字了：不玩撸啊撸、什莫意思啊\n查看12条评论\n156~\n楼主\n搞笑领域Yo主\n我哥哥在成都，他跟我说地震那会他在上小号，\n摇起来的时候，裤子都没来得及拉上来，然后一\n边开闸，一边跑，他兄弟在他后头朝他喊：别尿\n了！别尿了！我跑起来打滑！！！\n鳄鱼听了都要做鳄梦\n昨天19：28江西\n回复\n282\n佬目及趟面：这是这个个月我看到的最好笑\n的，笑得肚子疼\n五彩缤纷的黑苦茶：哈哈哈哈哈哈哈哈哈\n查看18条评论\n憧逢\n这次不是6.9级地震吗，怎么感觉没啥力度。08\n年那次7.2威力巨大啊\n〦\n不笑天灾、不笑人祸、不笑贫\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('146', '', '20,', '2022-09-06 142309.jpg', 'AUTO_ADD', '奶糖味的兔子\n四川肛肠科的消息已经走漏给日本人了！\norbn\n@FxUxCxKxExR\n池袋力于日本语通系四川料理食\n少穴爆凳、小現地人間肛門事情気\n\"四川肛門\"検索四川大量肛門\n科八力笑龙。死\n午後10：53·2022年6月8日·TwitterforiPhone\n3,246件少一下52件引用少一下1万件\n我在东京池袋吃了一家四川料\n理，店里服务员都不懂日语的\n那种超级正宗的，吃完后我的\n肛门爆炸了！然后我突然很想\n了解一下四川当地的人们肛门\n是否安好，于是搜了一下“四\n川肛门”，发现四川果然有\n大量的肛门科门诊！笑得我想\n死。\n梁丘夜\n1.2万\n这些医院大多在成都吧，如果我告诉你这些医\n院存在的意义不是因为食物太辣，你会是什么\n表情?\n头杀@爽豆花日w\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('147', '', '20,', '2022-09-08 115037.jpg', 'AUTO_ADD', '范臻\n十关注\n三只猫的小老弟\n我原本是一个剑三玩家来着的。\n从13年还在上大学的时候我就玩这游戏，十几\n个门派，每个我都有涉足。还买了一大堆盒子\n和外观。\n但是19年10月份搬进新家后，我却A了剑三，\n因为我发现这游戏有一个Bug针对我一一剑三会\n导致我的电脑自动重启。\n以前每次我登录游戏，玩游戏怎么玩都没事，\n非常流畅，不卡顿。\n但是自从我新家装修好，我搬进以后，只要我\n玩剑三，我那电脑就跟闹鬼了一样，时不时的\n电脑就自动重启。\n而且我玩其他游戏都没事，LOL随便打团，根\n本不卡。\n只有玩剑三的时候，会出现这样奇怪的故障。\n我咨询论坛的玩家，他们都没见过我这样的情\n况。\n我打了官方客服，客服说，是我硬件问题呢。\n我又找到了卖我电脑的商家，他们反复给我看\n了，也没问题。\n渐渐地，我发现了问题，就是只要有人在剑三\n里给我邮寄东西，我收到信件的第一时间，电\n脑就会自己重启。\n我放弃了，郭炜炜你什么垃圾服务器啊，老子\n不玩了。\n于是在剑三万宝楼（官方交易平台）把我号卖\n了。\n带踏炎和天策盒子的军爷号，才卖了800。\n特效武器青盒子的道长号，才卖了600。\n只剩下一个唐门号，实在没啥外观，卖不出\n去，烂手里了。\n我很心疼，但是我没办法，号不卖我也玩不了\n啊。\n直到前不久，我闲的没事在电脑看人直播玩剑\n三。\n主播游戏里面邮箱突然收到一封信件，然后我\n电脑TMD又自动重启了！\n那一瞬间我脑袋里一道电光闪过一一草，不会\n吧！？\n然后我低头一看我的主机箱。\n果不其然，我家猫趴在上面。\n破案了。\n剑三邮箱来信的提示声音，是一个很快的铃铛\n的音效，而这个音效，吸引了我家的猫。\n它听到音效，跳到了桌子下面的主机箱上，踩\n到了重启键。\n然后我电脑就重启了。\n发布于2022-08-1615：50·IP属地湖南·著作权归作者所\n有\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('148', '', '20,', '2022-09-08 120752.jpg', 'AUTO_ADD', '我越来越发现我男朋友好像有那大病\n怎么说？\n早上在包子店吃早饭，然后我们俩就\n坐一起吃\n然后这二货闲的无聊，吃了半个包\n子，把手指头从包子底下戳进去，冲\n我喊\n快看，包子里面有个手指头！\n+\n20:48\n2.3万\n然后全包子店的人都吓的站起来了！\n1.2万\n281\n', '0', '0', '0', '1');
