INSERT INTO `tbl_geng` VALUES ('181', '', '20,', '2022-09-26 100008.jpg', 'AUTO_ADD', '生活中你听到过哪些忍俊不禁的对话？\n写回答\n查看全部9,709个回答>\nnoodles\n+关注\n单身狗\n上次看达芬奇的画展，一家三口在达芬奇自画\n像面前，对话给我很有启发。\n妈妈：达芬奇非常厉害啊，他会画画，还会物\n理啊，数学，解剖啊，设计啊，机械啊，几乎\n是什么都会。\n小女孩：那达芬奇会做红烧肉吗？\n妈妈：。。。。。。应。。应该不会吧！\n小女孩：那还是爸爸比较厉害！\n爸爸：~(~)~\n编辑于2017-12-02·著作权归作者所有\n下一个回答\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('182', '', '20,', '2022-09-27 171710.jpg', 'AUTO_ADD', '我：“我喜欢吃西红柿，不喜欢吃香菜”\n网友A:“为什么要踩一捧一”\n网友B:“不喜欢就不喜欢，刷什么存在感”\n网友C:“不好意思，学名番茄，喜欢吃还叫错名\n字”\n网友D:“你是谁，需要你喜欢/不喜欢吗”\n网友E:“那你这辈子就只吃西红柿，千万别碰其\n他蔬菜不然我看不起你”\n网友F:“香菜做错了什么”\n网友G:“全世界都像你这样的话，种香菜的农民\n伯伯怎么办”\n网友H:“本质是你喜欢红色，不喜欢绿色是吧”\n网友！：“绿色很好，是你们给它赋予了不好的含\n义”\n网友J:“不喜欢就不喜欢，学不会尊重吗”\n网友K:“你一天吃几斤就敢说喜欢啊”\n网友L:“吃菜自由”\n网友M:“你碰一下香菜你是狗”\n网友N:“公主？那请麻烦你以后自己把菜里的香\n菜挑出来，别让厨师累死累活还要伺候你”\n网友O:“我就不喜欢吃西红柿，那你报警吧”\n网友P:“我就喜欢吃香菜，那你报警吧”\n网友Q:“我正好不喜欢吃西红柿，又喜欢吃香\n菜，那你报警吧”\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('183', '', '20,', '2022-09-27 171714.jpg', 'AUTO_ADD', '网友O:“我就不喜欢吃西红柿，那你报警吧”\n网友P:“我就喜欢吃香菜，那你报警吧”\n网友Q:“我正好不喜欢吃西红柿，又喜欢吃香\n菜，那你报警吧”\n网友R:“谁关心你喜欢吃什么不喜欢吃什么”\n网友S:“笑死，这年头蔬菜也歧视是吧”\n网友T:“冷知识，香菜有营养，其中所含的胡萝\n卜素要比西红柿高出10倍多”\n网友U:“我就吃香菜，气死你”\n网友V:“劝删，能不能别给我们西红柿招黑”\n网友W:“香菜因为香才有这个名字，西红柿不叫\n香柿，懂得都懂”\n网友X:“西红柿做错了什么要被你喜欢”\n网友Y:“你为什么喜欢西红柿不喜欢东红柿。你\n喜欢西方是吧，崇洋媚外”\n网友Z:“不好意思西红柿是水果，不混蔬菜圈”\n', '0', '0', '0', '1');
