INSERT INTO `tbl_geng` VALUES ('198', '', '20,', '2022-10-01 125352.jpg', 'AUTO_ADD', '匿名用户\n35人赞同了该回答\n异地恋，和女朋友开黑玩王者，我刚下班，\n她也在家里，刚打完视频，确实是在家里。\n游戏开始我玩澜，她本来要玩瑶，我让她选牛\n魔，虽然她觉得不好看，但拗不过我，只能玩\n牛魔了。\n刚开局，送一血，嗯，很对味，游戏到了一\n半，水晶马上要被推掉，我正准备殊死一搏的\n时候，女友闪现加大，一个控五个，我来不及\n多想，开大上去咬，疯狂刷二技能，杀了四\n个，另外一个跑掉了。\n逆风翻盘，游戏结束后，越想越不对劲，最后\n打视频过去，在逼问下，承认有个男的在她家\n里。\n最后，我和那男的双排了一晚上，上了七八颗\n星。\n好兄弟是真的C\n编辑于2022-09-0916：27·IP属地广东·著作权归作者所\n有\n赞同35\n', '0', '0', '0', '1');
