INSERT INTO `tbl_geng` VALUES ('212', '', '20,', '2022-10-12 174635.png', 'AUTO_ADD', '知乎\n17:46\n!\n穷。能只靠吃鸡蛋、米饭、维c片\n写回答\n知乎·198个回答>\n万的\n适龄提\n评论92\n写评论\n谢道\n南风\n我现在就买了一瓶复合的，但经常忘记吃\n09-25·IP属地河南\nQ\n查无此名12138\n减肥效果很好，现在连人带盒一斤半\n23小时前·IP属地山东\nQ\n83\n查看全部评论>\n赞同317\n69\n553\n92\n该问题的下一个回答\n喜喜\n+关注\n她的每一个回答都值得一看。\n267人赞同了该回答\n有一天去朋友店里玩，午餐时间，朋友指着旁边一\n个在准备午餐的店员对我说：她只吃蒸地瓜，其\n它什么也不吃，这样坚持了整整一年。\n我闻言大吃一惊，认真打量了一下那个一日三餐只\n吃地瓜的人。\n', '0', '0', '0', '1');
