INSERT INTO `tbl_geng` VALUES ('241', '', '20,', '2022-10-30 051415.png', 'AUTO_ADD', '05:14\n知乎\n邀请写回答\n如果潘金莲嫁给了又矮又丑的曹操，会如何\n通奸谋害亲夫？\n知乎·793个回答·2478关注>\n陆小凤\n+关\n凡人是否可用有限的生命，去穷尽宇宙的…\n龙开等7.4万人赞同了该回答\n本回答节选自盐选专栏，有助于解答该问题\n开玩笑，你把《水浒传》里的人的脑子放一块，看\n看能不能在曹孟德手下走两回，还谋害亲夫。\n我们不妨假设一下。\n话说那日，曹孟德青梅煮酒论英雄，送走刘玄德\n后，因多饮了几杯，感觉昏昏沉沉，便早些歇息\n了。\n睡梦中，迷迷糊糊，突然听到有人喊叫：「大郎，\n大郎，起来卖炊饼了。」\n曹操睁开眼睛，却见一貌美女子，虽是粗衣竲布，\n但挡不住的浑然天成。\n正是自己喜欢的类型。\n赞同7.4万\n2.2万\n6.3万\n3729\n', '0', '0', '0', '1');
