INSERT INTO `tbl_geng` VALUES ('267', '', '20,', '2022-08-08 133117.jpg', 'AUTO_ADD', '男朋友问我彩礼多少，我开玩笑说20万，\n男朋友直接放弃考虑结婚的事，打算只谈恋\n爱。我还该继续吗？\n知乎·1,329个回答·3039关注>\n八步赶蝉\n十关注\n渣男的矛与盾\n1.5万人赞同了该回答\n2百，2千，2万，200万，2000万，都像开玩笑。\n唯独你这个20万不像开玩笑。\n大家都是成年人了，你那点花花肠子谁看不出来啊。\n无非就是在试探你男朋友的态度罢了。\n这20万彩礼如果他答应了，我敢肯定你绝口不会提开玩笑这\n事。\n甚至你还会因为他答应的太痛快而觉得要少了，等结婚时大概\n率还得再抬一手价。\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('268', '', '20,', '2022-08-08 133210.jpg', 'AUTO_ADD', '上午9：19\n2.4K/s\n4G\nll\n76\n为什么女生提分手男生都基本答应？\n查看全部1,880个回答>\n邀请回答\n写回答\n默默的池塘\n十关注\n《巨傻瓜的社会学》主编人类小\n男生像狗，思路是决策型的。\n女生像猫，思路是试探型的。\n嘀\n奇怪……二哈的\n战斗值，今天高\n的反常？\n66666\n感谢图片作者圣绘宠物\n你一回家，猫跟狗都蹲在门边。\n狗必须跟你黏糊一阵，猫就是过来看看情况。\n关于【信任】\n男生跟你说，我所有事都信你。\n这是一个决策的开始。\n女生跟你说，我所有事都信你。\n这是一个试探的开始。\n关于【吃饭】\n男生说，吃什么都行。\n这是个决策，他真的吃什么都行。\n女生说吃什么都行。\n这是个试探，你得挨个问她吃什么。\n关于【意见】\n男生问，我穿这件衣服好看吗？\n这是个决策，你说好看，他就选那件。\n女生问，我穿这件衣服好看吗？\n这是个试探，你说好看，她会去试下一件。\n关于【暧昧】\n男生说，我不计较你和男同事来往。\n这是个决策，他不一定有底，他是决定不计较。\n女生说，我不计较你和女同事来往。\n这是个试探，具体要看你和哪个女同事来往。\n关于【礼物】\n男生说，亲爱的你不需要给我买礼物。\n这是个决策，你不买没任何风险。\n女生说，亲爱的你不需要给我买礼物。\n这是个试探，试试看你是不是真不买。\n关于【私奔】\n男生说，我带你走吧。\n这是个决策，他私奔路线都有个大概了。\n女生说，你带我走吧。\n这是个试探，试探后续的新剧情。\nSO..\n关于【分手】\n女生认为自己传递的是一个【试探】\n他最终告诉你的是一个【决策】\n补1【落水】\n为什么“我跟你妈掉水里你救谁“这种问题傻X?\n女生的思路，是在【试探】你对她的重视程度。\n而男生的思路，是在做要放弃谁的这个【决策】\n补1.1“你建议我救谁？”\n决策是很难的一件事情。这么一问回去，大部分女生\n也很为难。\n补1.2因为决策很难，很多女生很讨厌做决策，\"这种\n事为什么要让我做决定？\"也是常见的矛盾点之一。\n一一放下屠刀，立地成婚。\n编辑于昨天17：24·著作权归作者所有\n皮皮虾\n', '0', '0', '0', '1');
