INSERT INTO `tbl_geng` VALUES ('309', '', '20,', '2022-08-09 115339.png', 'AUTO_ADD', '8乎地852张富贵险中求！的\n洪爷看了哑巴一眼，慢条斯理\n的说道：\n“今天为师再告诉你一个人生真\n谛。追女孩儿的时候，不能只看对\n方的外表…”\n“那，那还看，看啥啊？”\n哑巴磕磕巴巴的问说。\n“还要看看自己的外表！”\n话一说完，洪爷便进了房间。\n哑巴一脸懵懂，问身边的小朵\n说：\n“啥啊，啥意思啊？”\n小朵面无表情的说了一句：\n“他说你长得丑，想得美！”\n哑巴摸了摸自己的脸，磕磕巴\n巴的自言自语道：\n“也，也不是太，太丑吧？”\n48%\n11:53\n5/1199.94%\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('310', '', '20,', '2022-08-09 155333.jpg', 'AUTO_ADD', 'MA足\n微博@seboii\n9岁的小男孩Paco Gutierrez一直想要一台\n任天堂游戏机。然而，这对生活在委内瑞拉\n的他而言是个遥不可及的梦想。凭着自己的\n创造力和叔叔的帮助下，他用硬纸板自制了\n超级马里奥，并把视频上传到油管上，视频\n迅速走红。多亏了这段视频，任天堂总裁\nDoug Bowser亲自前往委内瑞拉，向Paco\n以及他的家人索赔2亿美元的版权费\n@柠檬烯\n', '0', '0', '0', '1');
