INSERT INTO `tbl_geng` VALUES ('316', '', '20,', '2022-08-10 162021.jpg', 'AUTO_ADD', '赵老几的日常·6小时前\n91\n千万别跑外卖，我就是快递改送外卖的，一天到\n早忙到晚，尤其是晚上，那些女的穿着内衣就出\n来了拿外卖了，还让送到屋里，太没安全感了，\n我现在准备改行收废品\n4条回复\n白小姐的爱情故事·5小时前\n49\n千万别收废品，我就是外卖改收废品的，天天都\n在收垃圾，搞分类，一天到晚都是臭烘烘的，经\n常是收到别人的私房钱，可烦恼了，我现在准备\n改行当托尼\n回复\n你喜欢的男生·4小时前\n31\n千万别当托尼，我就是收废品改行托尼的。天天\n都在洗头，推会员卡，一天到晚浑身都是毛茬\n子。还经常碰到小可爱要染一个五彩斑斓的黑，\n太心酸了，我现在准备改行跑滴滴。\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('317', '', '20,', '2022-08-10 175131.jpg', 'AUTO_ADD', '中国电信HD\n4G\n100\n中国移动HD\n7:14\n微博正文\nAAIMALR\n洲动保之\n亚洲动保之声\n22-8-1006:42来自动保之声Harmon.已编辑\n发布于尼日尔\n【欧洲警方拟用爱狗人士取代警犬】近日，欧洲某\n地，警方拟用爱狗人士取代警犬进行日常巡罗，据\n知情警官透漏，相较于警犬，爱狗人士智商更高，\n更通人性，攻击性更强，可更好震慑当地居民。该\n计划有望在快速亚洲推广。\ngarbagehuman4.0\n@台湾傻事\nQ\n4,514次赞\n共278条评论\n@业保之声\n点赞是美意，赞赏是鼓励\n赞赏作者\n转发\n评论\n凸赞\n', '0', '0', '0', '1');
