INSERT INTO `tbl_geng` VALUES ('320', '', '20,', '2022-08-11 083805.jpg', 'AUTO_ADD', '第一步：读-逐个音素读出来\n大ling\n音素：48个，英语语音里最小的单位；音素构成音节，音节构成整个单词的音标。\n长元音\n[a:]\n[:]\n回\n[:]\n[u:]\n12个单元\narm\nher\nme\ndoor\ndo\n音\n元音\n短元音\n[A]\n[]\n[ae]\n[e]\nus\ndocter\nin\ndog\nlook\nat\negg\n8个双元音\n[ai]\n[ei]\n[i]\n[ia]\n[ea ]\n[ua]\n[au]\n[au]\neye\nA\nboy\near\nhair\npoor\nhow\ngo\n清辅\n[p]\n回\n[k]\n[s]\n山\n10\n音\n[L\npig\ntea\nkite\nsee\nship\ncheap\ntree\nthink\ncats\n对\n浊辅\n回\n[gl\n[d3]\n[d\n[dz]\n音\nboy\ndog\ngo\nvery\nZoO\nusual\norange\ndraw\nthis\nbeds\n辅音\n3个鼻音\n[m]\n回\nmom\nno\nsing\n3个似拼音\n回\nhow\nred\nleg\n2个半元音\n[w]\nev剪辑\nwater\nyes\nbilil\nEVX741177LW10\n注意其中有连体音素，如双元音和辅音里的破擦音：|ts||t]|tr|dz||d3| |dr|\n@ling\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('321', '', '20,', '2022-08-11 085200.jpg', 'AUTO_ADD', '特殊情况\n大ling小可爱\n1.浊化音\n以sp__, st _, sk__开头的单词中，清辅音/p/ t/k/分别要发浊辅音/b/ d/ /g/\nspoke [spaok]; student[\'stju:dnt]; sky[skar]\n2.不完全爆破\n4台\n爆破音[p] [b][t] [d] [k] [g]后面紧跟另一个爆破音时，前面的那个爆破音只在口腔内\n形成阻碍，而不能完全读出。\ne.g. basketball\n[\'ba:skrtb3:l\n3.连读\n在一个短语或句子中，如果相邻两词的关系相等密切，而前一个词以辅音结尾，后\n一个词以元音开头，辅音和元素连在一起读。\nev剪辑\nthe part of the earth\n@ling\n', '0', '0', '0', '1');
