INSERT INTO `tbl_geng` VALUES ('324', '', '20,', '2022-08-11 174209.jpg', 'AUTO_ADD', '下午9：588月28日周六\n22%\n<\n主题\n楼主\n老哥们，你们的闺女开始每个月会那啥的时候你们是怎么处理的？\n纯净梨花\n03177965\n楼主\n级别学徒威望发帖606\n2021-08-281817\n老婆出差了，今天接女儿放学回家，没想到正好是今天，他妈妈我没跟我提起过这个事，我也\n推荐\n不想知道，结果很尴尬\n先表个态，女儿这么重要的大事我自己竟然不了解，确实是我的责任，这点你们随便喷，我\n认……\n论坛\n一开始借到她我看她就怪怪的，像是不舒服的样子，结果回家路上走着走着她就突然蹲在地上\n了。刚想问她怎么回事，女儿就大吼一声，身上开始长出棕黑色的毛发（和我老婆的毛色一模一\n样)，然后眼睛变成了金黄色，獠牙长出来嘴巴越来越尖，我还没反应过来就完成变身了\n贼尴尬，才发现今天是月圆之夜\n好不容易安抚女儿平静下来，她已经咬死两个人了，好在没弄坏贵重的东西，只是两个隔壁吸\n血鬼老哥家养的人类奴隶，明天带点东西去给他们道个歉就好\n这会儿她暂时解除变身了，估计今晚还要再变一次，就是家里的气氛挺尴尬的，她好像很担心\n自己闯祸了所以我在生气\n我其实也不怪她，毕竟我小时候第一次变成狼人屠杀了一整个村子的人呢，现在的孩子其实自\n制力真的很强了\n就是不知道怎么安慰女儿\n76\n9十\n设\nFGWeiss\n37330494\n1楼\n级别学徒威望发帖837\n2021-08-2818.18\n???一开始看的好好的突然???\n312\n99十\n更多\n寄葉QwQ\n60091168\n2楼\n1/6\n', '0', '0', '0', '1');
