INSERT INTO `tbl_geng` VALUES ('344', '', '20,', '2022-08-14 082314.jpg', 'AUTO_ADD', '2022年7月22日上午11：00\n高中上学的时候我妈不让我刮胡子，班主任\n总埋汰我跟教导主任长得像。\n有一天我在学校门口，研究怎么把外卖带进\n来，门卫李老头突然过来说：“老师吃饭没\n呢？”\n我愣了一下说“还没，准备去拿外卖呢。”\n然后随便应付几句就出校门拿外卖去了。\n从那以后，每次我都能光明正大的走出校门\n拿外卖。\n764\n后来我跟李老头越来越熟，李老头了解到我\n24岁，在教导处专门收手机，当然这是我编\n的。我也了解到他有个女儿，25岁，有编\n制，170的个子，人美声甜。\n老李意味深长的对我说，我闺女挺好的，就\n是有点内向，要不你俩接触接触？\n我说行啊。\n就在这时，门卫室大门打开了，里面走出来\n一位化着淡妆的美丽女孩。\n是我班主任。\n然后我就被学校通报了，班主任也给我爹打\n电话了，我爹说那小子是不是又在班里泡泡\n面了？\n老师说，没泡泡面，泡我了。\n', '0', '0', '0', '1');
