INSERT INTO `tbl_geng` VALUES ('409', '', '20,', '2022-08-24 081327.jpg', 'AUTO_ADD', '我照顾了嫂子整整一夜\n我看到嫂子穿了一件很性感又有点透明的\n睡裙。\n“嫂子你的身材真棒啊”。\n“是吗，你哥哥可从没有这么说过我”。\n嫂子睡到床上，突然间有一个闷雷打响。\n嫂子吓得抱住了我，为了安慰嫂子，我把\n她抱在怀里抚摸着她的后背。\n慢慢的嫂子入睡了，我也有点困，迷迷糊\n糊的就一起睡了。\n早上，哥哥回来了，我们还没有醒。\n门被打开了，哥哥看着我和嫂子抱在一起\n睡觉，于是笑了，说：\n“还是我妹妹懂事，知道你嫂子怕打雷，我\n的名字心她睡不好。”\n皮皮虾\n', '0', '0', '0', '1');
