INSERT INTO `tbl_geng` VALUES ('429', '', '20,', '2022-06-26 224808.png', 'AUTO_ADD', '22:48\n卢瑟经济学安生杂谈>\n进入恶性通胀以后，不同商品的价格涨\n幅是不同的。\n以旧上海为例。\n涨幅最快的是煤、米、药、新闻纸、火\n柴、香烟、照明煤油、肥皂、汽油、鸦\n片之类。\n曾经有大药商囤积奎宁，把整箱的奎宁\n囤积起来，按片出售。\n社会动乱，大家都渴望了解信息，看到\n希望，于是，印刷报纸所需新闻纸腾\n贵。\n汽油是社会上层的必需品，没有汽油的\n车只能烧木柴，很快报废。\n鸦片就不用说了。\n这些商品，多数人既没有贮藏手段，也\n无法大规模进货，而且每天都要消耗，\n很容易成为围城中的面包。\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('430', '', '20,', '2022-06-26 224942.png', 'AUTO_ADD', '22:49\n卢瑟经济学安生杂谈>\n于是出现各种奇葩现象，腐败成风。\n消防队拿不到钱不救火，任由火灾蔓\n延。警察倒卖煤球和大米。\n有实权的大官僚当老虎，把囤积的收益\n转为美元、黄金或银元，转移美国，或\n者廉价收购古董、古玩、古书之类。\n没有实权的老师和小公务员，糊口都\n难。\n没人在乎债务，也不借债，有钱都去囤\n积生活日用品，其实也买不了多少，很\n快就会消耗掉。\n总结一下，物价涨幅速率比较：生活必\n需品第一，硬通货第二，工资和房租第\n三，纸币作废。\nMRneoanderson\n喜欢作者\n', '0', '0', '0', '1');
INSERT INTO `tbl_geng` VALUES ('431', '', '20,', '2022-06-26 224955.png', 'AUTO_ADD', '22:49\n卢瑟经济学安生杂谈>\n,从此我口口被折磨\n涨幅其次的是美元、金条和银元。\n这些商品充当货币，因为纸币贬值，大\n家需要交易和储值手段，所以也需要。\n但是，相比生产不断萎缩条件下的生活\n必需品，涨幅还是远远不足。\n围城之中，一个戒指换一个窝头，并不\n新鲜，只要手纸一样的法币，则是没人\n要的。\n劳动力的涨幅远远低于硬通货。大量人\n口失业，实际工资只能不断下降。\n房产的涨幅也会落后于硬通货，甚至落\n后于工资。\n上海罗迦陵的子孙拥有大批房产，但是\n糊口困难。因为生活必需品飞涨，大批\n劳动力失业的情况下，生存成了首要需\n求，绝大多数人选择牺牲居住条件，维\n持生命存在。\n', '0', '0', '0', '1');
