INSERT INTO `tbl_geng` VALUES ('537', '', '20,', '2022-08-03 054121.jpg', 'AUTO_ADD', '作者真的nb\n他说出了接头的暗号：“日本人体型偏瘦和\n人口老龄化的原因是什么？”\n秋宫月憋了几秒，才极为勉强的从嘴里吐\n出一句话：“原因是胖子和小男孩都炸了。”\n地狱笑话啊吧\n这应该就是赐死者的外围人员了，他用警惕\n的目光打量着许诚，说出了接头的暗号：“爰\n国在二战中做出了什么贡献？”\n许诚说出管理器提示的答桉：“举手之劳。”\n@他伏笑话\n她没有急着招呼许诚上车，而是侧过身来，\n饶有兴致的说出接头暗号：“世界上哪个民族\n的人最油滑？”\n许诚对管理器的恶趣味已经免疫了，说出答\n案：“是犹太人，因为他们擅长做肥皂。”\n@地狱笑话啊吧\n许诚并没有马上上车，反而说出了接头\n暗号：“美国人民不喜欢却又不得不吃的一道\n菜是什么。”\n上原良愣了愣，试着说出两人在电话里\n约定好的接头暗号：“吃枪子？”\n@地狱美话啊\n见到秋宫月有些奇怪的反应，许诚立刻问出\n了接头暗号：“十字教的主教们，最羡慕日本\n的哪一方面。”\n秋宫月顿时又绷不住了。\n她又觉得这个混蛋就是房东，因为他根本不\n是日本人，才会一直故意拿这件事开涮。\n但如果不说的话，恐怕会被许诚怀疑身份，\n秋宫月憋了几秒，才不情不愿从嘴里憋出一\n句话：“主教们羡慕日本的天空会掉小男孩。”\n', '0', '0', '0', '1');
