INSERT INTO `tbl_geng` VALUES ('577', '', '20,', '2022-08-05 170716.jpg', 'AUTO_ADD', '这都是人才啊！\n看到说浙江金华有家医院的口罩自动售卖\n机，价格从6块钱涨到了14块钱，很多病人\n抱怨太贵，厂家说没涨价呀！派人过来一\n看，机器上的两张收款二维码都是假的，被\n人掉包了。然而奇怪的是为什么扫假码，也\n能买口罩呢？后来抓到人一问，这人存了真\n二难码，有人扫假码，到账14块钱，他就扫\n真码花6块钱帮人家买一包。这你妈都是人\n才呀！\n', '0', '0', '0', '1');
